import React from 'react'
import Overdrive from 'react-overdrive'
import {
    BrowserRouter as Router,
    Route,
    Link
} from 'react-router-dom'

const img = 'data:image/jpeg;base64,';

const Home = () => (
    <div className="page">
        <h1>Feel free to navigate...</h1>
        <Overdrive id="element" style={{display: 'inline-block'}}>
            <img src={img} width="50%" alt="top secret"/>
        </Overdrive>
    </div>
);

const Circle = () => (
    <div className="page">
        <Overdrive id="element">
            <div className="circle"/>
        </Overdrive>
    </div>
);

const Square = () => (
    <div className="page">
        <Overdrive id="element">
            <div className="square"/>
        </Overdrive>
    </div>
);


const App = () => (
    <Router history={null}>
        <div>
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/circle">Circle</Link></li>
                <li><Link to="/square">Square</Link></li>
            </ul>

            <hr/>

            <Route exact path="/" component={Home}/>
            <Route exact path="/circle" component={Circle}/>
            <Route exact path="/square" component={Square}/>
        </div>
    </Router>
);

export default App;